import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';

const criterias = [
    {
      value: 'Keywords',
      label: 'Keywords',
    },
    {
      value: 'Author',
      label: 'Author',
    },
  ];

export default function Student() {
  return (
    <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
        <TextField
          id="filled-select-currency"
          select
          label="Select"
          defaultValue="Keywords"
          helperText="Search Category"
          variant="filled"
        >
          {criterias.map((option) => (
            <MenuItem key={option.value} value={option.value}>
              {option.label}
            </MenuItem>
          ))}
        </TextField>
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '50vw' },
      }}
      noValidate
      autoComplete="off"
      <div>
        <TextField
          required
          id="filled-required"
          label="Required"
          variant="filled"
        />
        </div>
    </Box>
  );
}
